/*
Auto-generated by: https://github.com/pmndrs/gltfjsx
Command: npx gltfjsx@6.2.7 scene.gltf
Author: S_F_Musashi (https://sketchfab.com/S_F_Musashi)
License: CC-BY-4.0 (http://creativecommons.org/licenses/by/4.0/)
Source: https://sketchfab.com/3d-models/residential-house-my-imagination-8cfc982b763a4f0abc8c2f4adac88f87
Title: Residential house (my imagination)
*/

import React from "react";
import { useGLTF } from "@react-three/drei";

export function Model(props) {
  const { nodes, materials } = useGLTF("/scene.gltf");
  return (
    <group {...props} dispose={null}>
      <group scale={0.025}>
        <mesh>
          geometry={nodes["Plane033_01_-_Default_0"].geometry}
          material={materials["01_-_Default"]}
          position={[-5, 15, 0]}
          rotation={[-Math.PI / 2, 0, 0]}
        </mesh>
      </group>
    </group>
  );
}

useGLTF.preload("/scene.gltf");
